INSERT INTO `categories` VALUES (17,'꽃피는 봄 기념 회원권 30% 세일','? 봄맞이 특별 혜택, 지금이 기회입니다. 회원권 등록 시 30% 할인 적용! 계절이 바뀌듯, 몸도 바꿔보세요. Playdata Gym이 함께하겠습니다.','3'),(18,'여름 준비 PT 100회 공동구매 이벤트','? 운동, 꾸준함이 답입니다. PT 100회 공동구매 시 대폭 할인 혜택. 가격 부담은 낮추고, 운동 효과는 올리세요. Playdata Gym에서 여름을 준비하세요.','3'),(19,'발리 태닝샵 제휴 이벤트','☀️ 운동 후, 태닝까지 완벽하게. 등록 시 제휴 태닝샵 할인 혜택 제공. 몸매와 피부 톤, 둘 다 챙기고 싶다면 지금이 적기입니다. Playdata Gym에서 관리 시작하세요.','3'),(20,'회원 등록 시 텀블러 증정 이벤트','? 운동 시작하는 당신에게 실용적인 선물! 회원 등록 시 고급 텀블러 증정. 작은 실천이 큰 변화를 만듭니다. Playdata Gym이 응원합니다.','3'),(21,'지인 추천 시 PT 1+1 이벤트','?‍♀️ 함께 운동하면 더 즐겁습니다. 지인 추천 시 PT 1회 추가 제공. 운동, 혼자보단 함께하는 게 꾸준해집니다. Playdata Gym에서 함께 시작하세요.','2'),(22,'오운완 챌린지: 25회 출석 시 단백질 셰이크','? 꾸준히 오운완 인증하고, 보상까지! 한 달 25회 이상 출석 시 단백질 셰이크 증정. 당신의 성실함, Playdata Gym이 기억합니다.','2'),(23,'바디 챌린지 우승 상금 300만원','? 운동 목표, 지금 바로 세워보세요. 바디 챌린지 참가 시 우승 상금 300만원. 진짜 변화를 원하는 당신, 도전해보세요. Playdata Gym이 함께합니다.','2'),(24,'재방문 시 PT 1회 서비스','? 잠시 쉬셨다면, 다시 시작할 타이밍입니다. 재방문 고객께 PT 1회 서비스 제공. 부담 없이 다시 운동 루틴을 만들어보세요. Playdata Gym에서 기다리고 있습니다.','1'),(25,'재등록 시 파트너 PT 1회 서비스','? 친구와 함께라면 더 쉬워집니다. 재등록 고객께는 파트너 PT 1회 서비스 제공. 같이 시작하면, 더 오래 가는 운동 습관! Playdata Gym과 함께 다시 도전하세요.','1'),(26,'작심삼일 챌린지 성공시 상금 50만원','? 3일을 넘기면, 기회가 됩니다. 작심삼일 챌린지 성공 시 상금 50만원 지급. 작은 도전이 당신을 바꿉니다. Playdata Gym이 응원합니다.','1'),(27,'VIP PT 체험권 1회 제공','? 한 번의 경험이 시작입니다. 지금 등록 시 VIP PT 1회 무료 체험 제공. 맞춤형 트레이닝을 직접 경험해보세요. Playdata Gym에서 준비했습니다.','0'),(28,'복귀 시 첫 달 회원권 0원','? 다시 돌아오신 분들께 드리는 혜택. 복귀 시 첫 달 회원권 0원 제공. 운동 습관, 다시 만들어갈 수 있습니다. Playdata Gym이 도와드릴게요.','0'),(29,'출석률 80% 달성 시 단백질 셰이크','? 꾸준함에는 보상이 따릅니다. 복귀 후 출석률 80% 달성 시 단백질 셰이크 1통 증정. 작은 성실함이 몸을 바꿉니다. Playdata Gym과 함께하세요.','0'),(30,'한 달 유지 시 회원권 20% 캐시백','? 운동 계속하면, 돌려드립니다. 복귀 후 한 달 이상 유지 시 회원권 20% 캐시백. 포기하지 않으면, 변화는 반드시 옵니다. Playdata Gym에서 함께해요.','0'),(31,'스트레칭 PT 무료 1회','? 운동이 무서워? 그럼 스트레칭부터 해. 지금 등록 시 스트레칭 PT 1회 공짜! 몸풀고, 마음풀고, 처음처럼 가볍게. Playdata Gym에서 기다립니다.','0'),(32,'웰컴박스 증정 (타올+셰이크3팩+키링)','? 돌아온 회원님을 위한 웰컴 선물! 복귀 시 타올, 셰이크 3팩, 키링 포함 웰컴박스 제공. 작은 선물로 다시 시작을 응원합니다. Playdata Gym에서 준비했습니다.','0');
